невозможен. Но в 1819 г. он понял свою ошибку, когда ему
доложили, что царь Александр II на рейде Кронштадта с
удовольствием прослушал и отметил прелесть одного музыкального
мотива. Ответьте, с какой рекой был непосредственно связан этот
мотив?
   Дунай;
   Рейн;
   Сена;
   Нева.

\u0412\u043e\u043f\u0440\u043e\u0441 15.\u0412\u043e\u043f\u0440\u043e\u0441:
Соревнования велосипедистов "гонки за лидером" проводились
еще в прошлом веке. А кто при отсутствии в то время
мотоциклистов, которые используются сегодня, выполнял роль
ведущего?
   велосипедный тандем;
   скаковая лошадь;
   карета;
   собака.

\u0412\u043e\u043f\u0440\u043e\u0441 16.\u0412\u043e\u043f\u0440\u043e\u0441:
Впервые каучук в Европу привез Колумб, но среди остальных
диковинок на него никто не обратил внимание.  Вторично  в Европу
его завез французский ученый, который говорил: "Это
замечательная штука! Из нее можно сделать десятки полезных вещей".
А какое изделие первым стали делать из сока гевеи?
   четки;
   мячи для игры в поло;
   жевательную резинку;
   ластик.

\u0412\u043e\u043f\u0440\u043e\u0441 15.\u0412\u043e\u043f\u0440\u043e\u0441:
Именно в библиотеке Ватикана хранится самая большая  коллекция
такой литературы  - 25500 томов. Что это за книги?
   атеистические;
   еретические;
   эротические;
   детективные.

